Writing to MongoDB without waiting for response<p>I'm trying to figure out how to write to a MongoDB using Mongoose and Node.js without waiting for the response. The typical way to write to MongoDB is either to use the callback syntax or use the await/async pattern. Both of these patterns don't execute the query unless you specify a call back or await the response. </p>

<p>Is there a way to write to MongoDB in a 'best-effort' fashion? I.e. just make the call, don't wait for the response, and if it succeeds great, and if not, no problem.</p>

<p>EDIT: </p>

<p>Code: </p>

<p>Async/await pattern: </p>

<pre><code>const doc = await Product.findByIdAndUpdate('prod1', {$inc: {viewed: 1}});
console.log(doc);
</code></pre>

<p>Callback pattern </p>

<pre><code>Product.findByIdAndUpdate('prod1', {$inc: {viewed: 1}, func(err, doc) {
    console.log(doc)
});
</code></pre>

<p>Both of these wait for the response.</p>

