How to update an object inside a Mongo Document Array (at a specific index)<p>I want to let a user check off whether they've "acquired" a grocery item and update the Database.</p>

<p>In more concrete terms, when a user checks a box, I want to toggle a Boolean property <code>acquired</code> on an ingredient object. Ingredients are stored in an array on the <code>GroceryList</code> document:</p>

<p>Here is the Schema for a Grocery List</p>

<pre><code>const GroceryListSchema = mongoose.Schema({
  createdAt         : { type: Date, default: Date.now },
  updatedAt         : { type: Date },
  ingredients       : { type: Array },
  recipes           : { type: Array },
  user              : { type: mongoose.Schema.Types.ObjectId, ref: 'UserSchema', required: true },
}
</code></pre>

<p>An ingredient looks like this:</p>

<pre><code>{ quantity: '3',
  unit: null,
  ingredient: 'zucchinis, chopped',
  minQty: '3',
  maxQty: '3',
  acquired: false }
</code></pre>

<p>I've looked at a lot of similar questions, the Mongoose documentation and the MongoDB documentation and I've tried a ton of different versions but I'm stumped.</p>

<p>Frontend:</p>

<pre><code>function toggleIngredient(elmt, groceryListId, ingrIdx) {
  $.post('/cart/grocery-list/toggleIngredient', {
    groceryListId,
    ingrIdx,
    newValue: elmt.checked, // if checkbox was checked before toggling it
  })
    .then((res) =&gt; {
      console.log(res);
    })
    .catch((err) =&gt; {
      console.log(err);
    });
}
</code></pre>

<p>Backend:</p>

<pre><code>  app.post('/cart/grocery-list/toggleIngredient', (req, res, next) =&gt; {
    const { groceryListId, ingrIdx, newValue } = req.body;

    GroceryListSchema.findById(groceryListId, (err, groceryList) =&gt; {
      if (err) return next(err);

      // if was unchecked, change to checked &amp; vice-versa
      groceryList.ingredients[ingrIdx].acquired = newValue;

      // save updated grocery list
      groceryList.save().then((updatedList) =&gt; {
        console.log(updatedList.ingredients);
      }).catch(error =&gt; next(error));
    });
  });
</code></pre>

<p><strong>RESULTS / THE PROBLEM:</strong>
When I run the code above, I successfully see 1 ingredient's <code>acquired</code> property get toggled from <code>false</code>-><code>true</code> in the callback</p>

<pre><code>console.log(updatedList.ingredients);
</code></pre>

<p>However, the next time I fetch the grocery list, that same ingredient's <code>acquired = false</code>. This leads me to believe that the <code>GroceryList</code> document isn't actually getting updated in the database. How do I fix this?</p>

